import React from 'react'

function Head() {
  return (
    <div style={{"height": "400px"}}>
        
        <div style={{"padding-top": "33px", "padding-left": "44px"}}>
            <h1 className='font-sans' style={{"font-size": "45px", "font-weight": "700", "color": "white"}}>Dashboard</h1>
            <p className='text-base' style={{"color": "rgb(179, 179, 179)", "margin-top": "-5px"}}>Welcome to your financial organizer!</p>
        </div>

    </div>
  )
}

export default Head
